css:
@-moz-document domain("sousoucili.com") {
body {background:#4b4a4ab8;font-size: 19px;}

DIV.wrap-content:nth-child(4) > DIV.wrap-header:first-child > DIV.header-top-box > DIV.msg:last-child > A:nth-child(n),
.list-zone .category a
{color:#a1d2dc!important}
.list-zone .item dt a b ,
.list-zone .item .flist p .name b{
    color: #fb9898;
}
.list-zone,
.content{background:#7a777700

}

DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DIV.sortby:nth-child(3),
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DIV.category:nth-child(4),
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n){
	background:#4d4a4a}

DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DT:first-child > A,
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DD.flist:nth-child(n) > P > SPAN.name:nth-child(n),
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(5) > DD.attr:nth-child(2) > SPAN:last-child > A{color:#89dc80;
	border:none;border-color:#a9a3a300}


DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DD.attr:nth-child(n) > SPAN:nth-child(n),
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DD.attr:nth-child(2) > SPAN:nth-child(n) > B,
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DD.attr:nth-child(2) > SPAN:last-child > A{color:#c0bebe!important}

DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DD.attr:nth-child(n) > SPAN:nth-child(6){
float:right !important
}

.list-zone .item .flist p .size{float:left!important;background:#507e57eb;
	color:#f2eeeeeb}

DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(n) > DD.attr:nth-child(2) > SPAN:nth-child(6) > A,
DIV.wrap-content:nth-child(4) > DIV.content:nth-child(2) > DIV.list-zone > DL.item:nth-child(5) > DD.attr:nth-child(2) > SPAN:last-child{color:#b5f58d!important}


.list-zone .category,.list-zone .item, .list-zone .item dt {
  
    border:none
}
.list-zone .sortby{border: 1px solid #ffa3a3;}

DIV.wrap-content:nth-child(n) > DIV.content:nth-child(n) > DIV.list-zone > DIV.sortby:nth-child(n) > A.active:nth-child(n),
.header-top-box .search .searchBox .btn button{background:#ff9494}
}
